import React from "react";
import NameIntro from "./components/nameintro";
import LatestArticle from "./components/latestarticle";
import AboutSection from "./components/aboutsection";
import ArticleSpread1 from "./components/articlespread1";
import ArticleSpread2 from "./components/articlespread2";
import "./App.css";

function App() {
  return (
    <div
      id="wrapper"
      style={{
        display: "grid",
        gridTemplateColumns: "repeat(auto-fit, 430px)",
        gridTemplateRows: "700px 600px 600px 500px",
        gridColumnGap: 200,
      }}
    >
      <div>
        <NameIntro />
      </div>
      <div>
        <LatestArticle />
      </div>
      <div id="aboutSection">
        <AboutSection />
      </div>
      <div>
        <ArticleSpread1 />
      </div>
      <div>
        <ArticleSpread2 />
      </div>
    </div>
  );
}

export default App;
